import React from "react";

const Hero = () => {
  return <div className="hero">Hero</div>;
  <div className="content">
    <p>Call us</p>
    <p>+85267901714</p>
    <p>Because Moeny</p>
    <p>Doesn't come with instruction</p>
    <button href="/" className="buttons"></button>
  </div>;
};

export default Hero;
